import './App.css';
import Home from "./pages/Home";
import FunkySnake from './pages/FunkySnake';
import { Route, Switch } from "react-router-dom";

function App() {
  return (
    <>
      <Switch>
        <Route exact path="/">
          <Home />
        </Route>
        <Route path="/funky_snake">
          <FunkySnake />
        </Route>
      </Switch>
    </>
  );
}

export default App;
